import './App.css';
import React from 'react'
import {Routes, Route} from 'react-router-dom';
import IndexPage from '../src/page/IndexPage';
import RegSong from '../src/page/RegSong';
import ModeSel from '../src/page/ModeSel';
import GameBoard from '../src/page/GameBoard';


function App() {
  return (
      <Routes>
        <Route path="/" element={<IndexPage/>}/>
        <Route path="/board/regSong" element={<RegSong/>}/>
        <Route path="/board/modeSel" element={<ModeSel/>}/>
        <Route path="/board/multiGameBoard" element={<GameBoard/>}/>
      </Routes>
  );
}

export default App;
